INSERT INTO `v1_7382dcfaca88e9d131c193ea7e513c66ca822b4978b70c86a85b37c6612894a5` VALUES (110501, 0.0, "2030/12/17 14:59:59", 0.0, 0.0, 24015, 4, "カオリ（サマー）", 1, 4, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", "2019/07/31 12:00:00", 10021, 24);
INSERT INTO `v1_7382dcfaca88e9d131c193ea7e513c66ca822b4978b70c86a85b37c6612894a5` VALUES (110501, 0.0, "2030/12/17 14:59:59", 4.0, 0.0, 24016, 1, "カオリ（サマー）", 2, 4, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", "2019/07/31 12:00:00", 10021, 24);
INSERT INTO `v1_7382dcfaca88e9d131c193ea7e513c66ca822b4978b70c86a85b37c6612894a5` VALUES (110501, 0.0, "2030/12/17 14:59:59", 0.0, 0.0, 24017, 4, "カオリ（サマー）", 3, 4, "マジムンだらけで目が回るさ～！\nふらふらさ～！", "2019/07/31 12:00:00", 10021, 24);
INSERT INTO `v1_7382dcfaca88e9d131c193ea7e513c66ca822b4978b70c86a85b37c6612894a5` VALUES (110501, 0.0, "2030/12/17 14:59:59", 5.2, 0.0, 24018, 2, "カオリ（サマー）", 4, 1, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", "2019/07/31 12:00:00", 10021, 24);
INSERT INTO `v1_7382dcfaca88e9d131c193ea7e513c66ca822b4978b70c86a85b37c6612894a5` VALUES (110501, 0.0, "2030/12/17 14:59:59", 4.2, 0.0, 24019, 6, "カオリ（サマー）", 5, 5, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", "2019/07/31 12:00:00", 10021, 24);
INSERT INTO `v1_7382dcfaca88e9d131c193ea7e513c66ca822b4978b70c86a85b37c6612894a5` VALUES (110501, 0.0, "2030/12/17 14:59:59", 0.0, 0.0, 24020, 2, "カオリ（サマー）", 6, 2, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", "2019/07/31 12:00:00", 10021, 24);
INSERT INTO `v1_7382dcfaca88e9d131c193ea7e513c66ca822b4978b70c86a85b37c6612894a5` VALUES (110501, 0.0, "2030/12/17 14:59:59", 6.4, 0.0, 24021, 6, "カオリ（サマー）", 7, 1, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", "2019/07/31 12:00:00", 10021, 24);
INSERT INTO `v1_7382dcfaca88e9d131c193ea7e513c66ca822b4978b70c86a85b37c6612894a5` VALUES (110501, 0.0, "2030/12/17 14:59:59", 0.0, 0.0, 24022, 2, "カオリ（サマー）", 8, 2, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", "2019/07/31 12:00:00", 10021, 24);
INSERT INTO `v1_7382dcfaca88e9d131c193ea7e513c66ca822b4978b70c86a85b37c6612894a5` VALUES (110501, 0.0, "2030/12/17 14:59:59", 10.08, 0.0, 24023, 3, "カオリ（サマー）", 9, 6, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", "2019/07/31 12:00:00", 10021, 24);
INSERT INTO `v1_7382dcfaca88e9d131c193ea7e513c66ca822b4978b70c86a85b37c6612894a5` VALUES (110501, 0.0, "2030/12/17 14:59:59", 5.0, 0.0, 24024, 2, "カオリ（サマー）", 10, 1, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", "2019/07/31 12:00:00", 10021, 24);
INSERT INTO `v1_7382dcfaca88e9d131c193ea7e513c66ca822b4978b70c86a85b37c6612894a5` VALUES (110501, 0.0, "2030/12/17 14:59:59", 0.0, 0.0, 24025, 2, "カオリ（サマー）", 11, 2, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", "2019/07/31 12:00:00", 10021, 24);
